<script lang="ts">
	import { cardData } from '../../stores/cardData';
	import { browser } from '$app/environment';

	let canvasElement: HTMLCanvasElement;
	let svgElement: SVGSVGElement;
	let blobUrl: string;

	function svgToCanvas() {
		if (!browser) return;

		let { width, height } = svgElement.getBoundingClientRect();

		blobUrl =
			'data:image/svg+xml; charset=utf8, ' + encodeURIComponent(serializeString(svgElement));

		console.log(blobUrl);

		let img = new Image();

		img.onload = () => {
			if (!canvasElement) return;

			canvasElement.width = width;
			canvasElement.height = height;
			canvasElement.getContext('2d').drawImage(img, 0, 0);
		};

		img.src = blobUrl;
	}

	// This function serializes SVG and sets all necessary attributes
	function serializeString(svg: SVGSVGElement) {
		const xmlns = 'http://www.w3.org/2000/xmlns/';
		const xlinkns = 'http://www.w3.org/1999/xlink';
		const svgns = 'http://www.w3.org/2000/svg';
		svg = svg.cloneNode(true);
		const fragment = window.location.href + '#';
		const walker = document.createTreeWalker(svg, NodeFilter.SHOW_ELEMENT, null, false);
		while (walker.nextNode()) {
			for (const attr of walker.currentNode.attributes) {
				if (attr.value.includes(fragment)) {
					attr.value = attr.value.replace(fragment, '#');
				}
			}
		}
		svg.setAttributeNS(xmlns, 'xmlns', svgns);
		svg.setAttributeNS(xmlns, 'xmlns:xlink', xlinkns);
		const serializer = new XMLSerializer();
		const string = serializer.serializeToString(svg);
		return string;
	}
</script>

